import React from 'react'
import {useNavigate} from 'reacr-router-dom'

export default function InscreverSe () {
    const navigate = useNavigate()

    const vaiParaHome = () => {
        navigate("/")
    }

  return (
    <>
    <button onClick = {vaiParaHome}/>
    </>
  )

    
}
